var clm = require('clmtrackr');

export default function() {

  var appDiv = document.getElementById('app-coin');

  var tpl = `
  <video
    id="src-video"
    autoplay
    controls
    style="border: 1px solid black;">
  </video>

  <canvas
  id="dst-canvas"
  style="width: 600px;height: 600px;border: 1px solid black;">
  </canvas>

  <fieldset>
      <legend>Adjustments</legend>

      <label for="brightness">Brightness</label>
      <input type="range" id="brightness" name="brightness"
             min="0" max="2" value="1" step=".001" />

      <label for="contrast">Contrast</label>
      <input type="range" id="contrast" name="contrast"
             min="0" max="2.6" value="1.3" step=".001" />

  </fieldset>
  `;
  appDiv.innerHTML = tpl;


  var videoDom = document.getElementById('src-video');
  var canvas = document.getElementById('dst-canvas');
  var ctx = canvas.getContext('2d');

  var ctracker = new clm.default.tracker();

  var scrVidDimensions = false;
  var srcCoordinates = false;

  // VIDEO->CANVAS loop
  var display = function(){
    var coinImg = new Image();
    coinImg.src = coin64();
    function loop(){


      var brightness = document.getElementById('brightness').value;
      brightness = (brightness < 1) ? brightness : ((brightness*5)-4);

      var contrast = document.getElementById('contrast').value;
      contrast = (contrast < 1) ? contrast : ((contrast*5)-4);

      ctx.filter = 'saturate(0) contrast('+contrast+') sepia(100) brightness('+brightness+')';
      ctx.drawImage(
        videoDom,
        srcCoordinates.x1 / scrVidDimensions.w, //SX coordinate of the source image // X coordinate in the destination canvas
        srcCoordinates.y1 / scrVidDimensions.h, //SY coordinate of the source image // Y coordinate in the destination canvas
        (srcCoordinates.x2 - srcCoordinates.x1) / scrVidDimensions.w, //SW width of the sub-rectangle of the source image
        (srcCoordinates.y2 - srcCoordinates.y1) / scrVidDimensions.h, //SH height of the sub-rectangle of the source image
        scrVidDimensions.w * .43, //DX X coordinate in the destination canvas
        scrVidDimensions.h * .36, //DY Y coordinate in the destination canvas at which
        scrVidDimensions.w * .2, //DW width to draw the image in the destination canvas
        scrVidDimensions.h * .28  //DH height to draw the image in the destination canvas
      );
      ctx.filter = 'saturate(0) contrast(1) sepia(100) brightness(1)';
      ctx.drawImage(coinImg, 0, 0, scrVidDimensions.w, scrVidDimensions.h);
    }
    setInterval(loop, 200);
  }








  // TRACKING
  var startTracking = function() {
    function positionLoop() {
      requestAnimationFrame(positionLoop);
      var positions = ctracker.getCurrentPosition();
      if (positions) {
        let _srcCoordinates = {
          x1: positions[0][0],
          y1: positions[0][1],
          x2: positions[0][0],
          y2: positions[0][1],
        };
        positions.forEach(function(pos){
          if (_srcCoordinates.x1 > pos[0]) { // most left
            _srcCoordinates.x1 = pos[0];
          }
          if ( _srcCoordinates.y1 > pos[1]){ // topest
            _srcCoordinates.y1 = pos[1];
          }
          if (_srcCoordinates.x2 < pos[0]) { // most right
            _srcCoordinates.x2 = pos[0];
          }
          if ( _srcCoordinates.y2 < pos[1]){ // bottomest
            _srcCoordinates.y2 = pos[1];
          }
        });

        srcCoordinates = {
          x1: _srcCoordinates.x1 * scrVidDimensions.w,
          y1: _srcCoordinates.y1 * scrVidDimensions.h,
          x2: _srcCoordinates.x2 * scrVidDimensions.w,
          y2: _srcCoordinates.y2 * scrVidDimensions.h
        }
      }

    }
    setTimeout(positionLoop, 100);
  }



  //
  // TEST CANVAS
  //
  var testCanvas = function(){
    var testCanvas = document.createElement('canvas');
    var testCtx = testCanvas.getContext('2d');
    testCanvas.width = scrVidDimensions.w;
    testCanvas.height = scrVidDimensions.h;
    testCanvas.style.border   = "1px solid black";
    appDiv.appendChild(testCanvas);
    let testDraw = function() {
      testCtx.drawImage(
        videoDom,
        0, //SX coordinate of the source image // X coordinate in the destination canvas
        0, //SY coordinate of the sub-rectangle of the source image // Y coordinate in the destination canvas
        scrVidDimensions.w, //SW width of the sub-rectangle of the source image
        scrVidDimensions.h, //SH height of the sub-rectangle of the source image

        0, //DX X coordinate in the destination canvas
        0, //DY Y coordinate in the destination canvas at which
        scrVidDimensions.w, //DW width to draw the image in the destination canvas
        scrVidDimensions.h  //DH height to draw the image in the destination canvas
      );
      if (!!ctracker.getCurrentPosition()) {
        ctracker.draw(testCanvas);
      }
    }
    setInterval(testDraw, 100);
  }




  //
  // VIDEO READY
  //
  videoDom.oncanplay = function(){
    scrVidDimensions = {
      w: videoDom.videoWidth,
      h: videoDom.videoHeight
    }
    videoDom.width = scrVidDimensions.w;
    videoDom.height = scrVidDimensions.h;
    canvas.width = scrVidDimensions.w;
    canvas.height = scrVidDimensions.h;
    ctracker.init();
    ctracker.start(videoDom);
    testCanvas();
    startTracking();
    display();
  }



  //
  // CAMERA ---> <VIDEO>
  //
  navigator.getUserMedia = (navigator.getUserMedia ||
    navigator.webkitGetUserMedia ||
    navigator.mozGetUserMedia ||
    navigator.msGetUserMedia
  );
  if (navigator.getUserMedia) {
    navigator.getUserMedia(
      {
        video:true,
        audio:false
      },
      function(stream) {
        var url = window.URL || window.webkitURL;
        videoDom.src = url ? url.createObjectURL(stream) : stream;
        videoDom.play();
      },
      function(error) {
        console.log('getUserMedia error ::', error);
        return;
      }
    );
  }
  else {
    console.log('Sorry, the browser you are using doesn\'t support getUserMedia');
    return;
  }






  var coin64 = function() {
  return "data:image/png;base64,";
  }


}
